import React from 'react'
import Button from 'react-bootstrap/Button';
import Card from 'react-bootstrap/Card';

export default function CounterService() {
    return (
        <Card style={{ width: '18rem' }}>
          <Card.Body>
            <Card.Title><h1>Counter Service</h1></Card.Title>
            <Card.Text>

                <Card.Img variant="top" src="https://cdn.cipherlab.com/comm/upimage/f-170821-03556.jpg" height={300} width={300}/>
          
              <h2>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Counter-service restaurants usually have a small menu of prepared foods, 
            such as sandwiches, salads, and coffee which are ordered and paid for at the counter. 
            Customers can then bring their food to the table or eat on the go.</h2>
            </Card.Text>
            {/* <Button variant="primary">Go somewhere</Button> */}
          </Card.Body>
        </Card>
      );
}
